class AxiosReactExample extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data:[],
    }
  }

  componentDidMount() {
    axios.get("https://api-nodejs-todolist.herokuapp.com/task",{

      headers:{
        "Authorization":"Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJfaWQiOiI2MDA4Y2MzZTVhYjQ2ZjAwMTdiOGY2NGUiLCJpYXQiOjE2MTcxMDM5MDJ9.9djKES2nNL5AB503hu0t2NarPKiS5UQwTBOJbnEopws",
        "Content-Type":"application/json"
      }
      
          })
    .then(response => {
      console.log(response.data);
      this.setState({ data: response.data.description });
    })
    .catch(error => {
      console.log(error);
    });
  }

  render() {
    const { imageURL } = this.state;
    return (
      <div>
        <h1>Axios with React Example</h1>
        <h2>How to make API requests in React using Axios</h2>
        <img src={imageURL} alt="dog" />
      </div>
    );
  }
}

ReactDOM.render(<AxiosReactExample />, document.getElementById('root'))



























import React,{useState} from 'react';
class Todo extends React.Component {
  constructor(props) {
    super(props);
    this.state = { 
      data:[]     
    };
  }

  componentDidMount() {
    fetch("https://api-nodejs-todolist.herokuapp.com/task",{
      method:"GET",
      headers:{
        "Authorization":"Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJfaWQiOiI2MDA4Y2MzZTVhYjQ2ZjAwMTdiOGY2NGUiLCJpYXQiOjE2MTcxMDM5MDJ9.9djKES2nNL5AB503hu0t2NarPKiS5UQwTBOJbnEopws",
        "Content-Type":"application/json"
      }
      
          })
      .then(response => response.json())
      .then(task => {
        const data2 = task.results;
        this.setState({
           data: data2
          
          });
      });
    
  }

  render() {
    console.log(this.state.data);
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">Floyd's API Call</h1>
        
        </header>
        <div class="table-responsive">
          <table className="table">
            <thead>
              <tr>
                <th>Firstname</th>
                <th>UserName</th>
               
              </tr>
            </thead>
          
          </table>
        </div>
      </div>
    );
  }
}




export default Todo
